import React from 'react'

function ListUsers({users = []}) {

  return (
    <>
      <h1>Usuarios</h1>
      <ul>
        {users.map((u, index) => (
          <li key={index}>{u.usuario}</li>
        ))}
      </ul>
    </>
  )
}

export default ListUsers
